import { Link, useLocation, useNavigate } from "react-router-dom";

import { useState } from "react";
import { cloneDeep } from "lodash";
import { useDispatch, useSelector } from "react-redux";

import classNames from "classnames";

import useAuth from "../hooks/use-auth";
import { update_allowed_tabs, update_is_next_tab_allowed } from "../redux/features/allowedTabsSlice";

import HanhwaLogo from "../img/hanhwa-logo.svg";
import { reset_allowed_basic_info_pages } from "../redux/features/allowedSectionPages/allowedBasicInfoPages";
import { homeAddress } from "../utils/appConstants";
import { getNavURL } from "../utils/appUtils";

function NavTopBar() {
  const navigate = useNavigate();
  const reduxDispatch = useDispatch();
  const location = useLocation();

  const AllowedTabs = useSelector(state => state.allowedTabs)
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  const toggleHamburguerMenu = () => setIsMenuOpen(prev => !prev)

  const { userToken, onLogout } = useAuth();

  const handleLogout = () => {
    onLogout()
  }

  const handleNextTabClick = () => {
    const newAllowedTabsObj = cloneDeep(AllowedTabs)
    // delete newAllowedTabsObj.projectId
    const entries = Object.entries(newAllowedTabsObj)

    let prevTab = ""
    let nextTab = ""

    //WARNING: this works cause there can only be two active tabs at the same time
    for (let i = 0; i < entries.length; i++) {
      const element = entries[i];

      if(typeof element[1] === "boolean"){
        if(element[1] === true){
          if(prevTab === ""){
            prevTab = element[0]
          }else if(nextTab === ""){
            nextTab = element[0]
          }
        }
      }
    }

    newAllowedTabsObj[prevTab] = false
    newAllowedTabsObj[nextTab] = true

    let navigateAddress = getNavURL("/basic-info/inlet") 

    switch (nextTab) {
      case "tea":
        reduxDispatch(reset_allowed_basic_info_pages())
        navigateAddress = getNavURL("/tea/unit-design")
        break;
      case "lca":
        navigateAddress = getNavURL("/lca/project-info")
        break;
      case "summary":
        navigateAddress = getNavURL("/summary/capex")
        break;
      case "sensitivityAnalysis":
        navigateAddress = getNavURL("/sensitivity-analysis/input")
        break;
      default:
        navigateAddress = homeAddress
        break;
    }

    reduxDispatch(update_allowed_tabs(newAllowedTabsObj));
    reduxDispatch(update_is_next_tab_allowed(false))
    navigate(navigateAddress);
  }

  const DisplayText = ({label, link}) => {
    const displaytextClassName = classNames(
      "navbar-item is-italic",
      location.pathname.includes(link) && "has-text-link"
    );

    return(
      <div className={displaytextClassName}>
        {label}
      </div>
    );
  }

  const NextTabButton = () => {
    if(AllowedTabs.isNextTabAllowed){
      return(
        <div className="buttons ml-4">
          <button className="button is-primary" onClick={handleNextTabClick}>
            <span className="icon-text">
              <span>Next Tab</span>
              <span className="icon">
                <i className="fas fa-arrow-right"></i>
              </span>
            </span>
          </button>
        </div>
      );
    }else{
      return <></>
    }
  }

  const accountUrl = getNavURL("/account");
  const url1= getNavURL("/basic-info");
  const url2= getNavURL("/tea");
  const url3= getNavURL("/lca");
  const url4= getNavURL("/summary");
  const url5= getNavURL("/sensitivity-analysis");

  return (
    <nav className="navbar" role="navigation" aria-label="main navigation">
      <div className="navbar-brand">
        <div className="navbar-item" href="https://bulma.io">
          <img src={HanhwaLogo} width="112" height="28" alt="Hanhwa company logo"/>
        </div>

        <button className="navbar-burger" aria-label="menu" aria-expanded="false" data-target="navbarBasicExample"  onClick={toggleHamburguerMenu}>
          <span aria-hidden="true"></span>
          <span aria-hidden="true"></span>
          <span aria-hidden="true"></span>
        </button>
      </div>

      <div id="navbarBasicExample" className={`navbar-menu ${isMenuOpen && "is-active"}`}>
        <div className="navbar-start">
          {!(location.pathname === homeAddress) &&(
            <>
            <Link className="navbar-item" to={homeAddress}>
              Home
            </Link>
              {!(location.pathname === accountUrl)&&(
              <>
              <DisplayText label="Basic Information" link={url1}/> 
              <DisplayText label="TEA" link={url2}/> 
              <DisplayText label="LCA" link={url3}/> 
              <DisplayText label="Summary" link={url4}/> 
              <DisplayText label="Sensitivity Analysis" link={url5}/> 
              </>
            )}
          </>
          )}

          <NextTabButton/>

        </div>

        <div className="navbar-end">          
          {location.pathname !== accountUrl &&(
            <div className="navbar-item has-dropdown is-hoverable">
              <div className="navbar-link">
                Account
              </div>

              <div className="navbar-dropdown is-right">
                <Link className="navbar-item" to={accountUrl}>Information</Link>
                <Link className="navbar-item has-text-danger" onClick={handleLogout}>Log Out</Link>
                <hr className="navbar-divider"/>
                <div className="navbar-item">{userToken?.email}</div>
              </div>              
            </div>
          )}
        </div>
      </div>
    </nav>
  );
}

export default NavTopBar;
